// components/ViolationList.js

import React, { useEffect, useState } from 'react';

const ViolationList = () => {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchViolations = async () => {
      const token = localStorage.getItem('token'); // Get token from local storage
      if (!token) {
        console.log('No token found');
        setLoading(false);
        return;
      }

      try {
        const response = await fetch('http://localhost:3001/api/users/violations', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            'x-auth-token': token, // Include token in headers
          },
        });

        if (!response.ok) {
          throw new Error('Failed to fetch violations.');
        }

        // If the response is okay, print "hi" to the console
        console.log('hi');
      } catch (err) {
        console.error(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchViolations();
  }, []);

  if (loading) return <div>Loading...</div>;

  return (
    <div>
      <h2>Your Violations</h2>
      <p>No violations recorded.</p>
    </div>
  );
};

export default ViolationList;
